import {
  AfterViewInit,
  ChangeDetectionStrategy, ChangeDetectorRef,
  Component,
  EventEmitter,
  Input,
  OnInit,
  Output,
  ViewEncapsulation
} from '@angular/core';

@Component({
  selector: 'location-console-action',
  templateUrl: './location.html',
  styleUrls: ['./location.scss'],
  encapsulation: ViewEncapsulation.None,
  changeDetection: ChangeDetectionStrategy.OnPush
})

export class LocationConsoleActionComponent implements OnInit, AfterViewInit {
  @Input() action: any;
  @Input() inverted = false;
  @Input() primaryColor = '#30B286';
  @Input() textColor = '#FFFFFF';
  @Input() autoScroll? = true;
  @Input() readOnly = false;
  @Output() onSendReply = new EventEmitter<any>();
  @Output() onLoadNextAction = new EventEmitter<boolean>();
  @Output() onLastActionRendered: EventEmitter<boolean> = new EventEmitter<boolean>();

  public message: string;
  public isOver = false;
  public latlng: string;

  constructor(private cdr: ChangeDetectorRef) { }

  ngOnInit() {
    this.onLoadNextAction.emit(true);

    if (this.autoScroll) {
      setTimeout(() => {
        let element = document.getElementById('chat-console-messages');
        if(element) {
          element.scrollTop = element.scrollHeight - element.clientHeight;
          this.cdr.markForCheck();
        }
      }, 500);
    }
  }

  ngAfterViewInit() {
    setTimeout(() => {
      this.onLastActionRendered.emit(true);
    }, 0);
  }

  getLocation() {
    if (!this.isOver) {
      if (window.navigator && window.navigator.geolocation) {
        window.navigator.geolocation.getCurrentPosition(
          position => {
            this.updatePosition(position)
          },
          error => {
            switch (error.code) {
              case 1:
                console.log('Permission Denied');
                break;
              case 2:
                console.log('Position Unavailable');
                break;
              case 3:
                console.log('Timeout');
                break;
            }
          }
        );
      }
    }
  }

  updatePosition(position) {
    this.latlng = position.coords.latitude + ',' + position.coords.longitude;
    this.isOver = true;
    this.cdr.markForCheck();
  }

  sendReply() {
    this.onSendReply.emit(this.action.action);
  };

}
<div class="console-location-type">
  <div class="bubble" [ngClass]="{'bot': !inverted, 'user': inverted}" [style.background-color]="primaryColor"
       [style.color]="textColor">
    <span *ngIf="!inverted" [style.border-right-color]="primaryColor" class="bubble-arrow"></span>
    {{action.message}}
    <span *ngIf="inverted" [style.border-left-color]="primaryColor" class="bubble-arrow-right"></span>
  </div>
  <button style="margin-top:10px;margin-left:60px;" (click)="getLocation()" [disabled]="readOnly"
          [ngClass]="{'clustaar-green-button small': isOver, 'clustaar-blue-button secondary small': !isOver, 'bot': !inverted, 'user': inverted}">
    Send location
  </button>
  <img [ngClass]="{'bot': !inverted, 'user': inverted}" style="margin-top:10px;width: 80%;margin-left: 5px;"
       *ngIf="isOver"
       src="https://maps.googleapis.com/maps/api/staticmap?center={{latlng}}&zoom=16&size=300x300&sensor=false&key=AIzaSyC2f8kNtvvjIto5MSzXOh9rVZ0ZqLl0BCU">
</div>
